    [],nt"revision_timestamp": "2015-04-03T11:15:18.869422",nt"name": "multifamily-housing-physical-inspection-scores",nt"isopen":
    false,nt"url": null,nt"notes": "HUD's Real Estate Assessment Center conducts
    physical property inspections of properties that are owned, insured or subsidized
    by HUD, including public housing and multifamily assisted housing. About 20,000
    such inspections are conducted each year to ensure that assisted families have housing
    that is decent, safe, sanitary and in good repair. This page provides a full historical
    view of the results of those inspections, providing point-in-time property scores.
    Results are available for download as a comma-delimited dataset. Separate datasets
    are available for public housing and for multifamily assisted properties. The results
    represent the inspections conducted from 2001 through January 2015. The dataset
    includes property identifiers and location information. rnrnDetailed descriptions
    of the inspection processes can be found in Federal Register notices 66 FR 59084
    for public housing and 65 FR77230 for Office of Housing programs. rnrnMaking these
    inspection details available will enable researchers, advocacy groups and the general
    public to rn 1) better understand the physical condition of the HUD-assisted housing
    stock, as well as changes in the stock over time;rn 2) hold providers accountable
    for housing quality; and rn3) plan for future affordable housing needs.",nt"license_title":
